import React from 'react';
import { View, Text, TouchableOpacity, TextInput, } from 'react-native';
import styles from './style';
import Icon from 'react-native-vector-icons/MaterialCommunityIcons';

export default function Home() {
  return (
    <View style={styles.container}>
      <View style={styles.contentHeader}>
        <Text style={styles.textLogo}>Almox.in</Text>
        <Text> Seja Bem-vindo Roberto</Text>
        <TouchableOpacity>
          <Icon name="logout" size={35} color="#000000" />
        </TouchableOpacity>
      </View>
      <View style={styles.contentSearch}>
        <TextInput placeholder='Busque usuário' style={styles.input} />
        <TouchableOpacity>
          <Icon name="account-search-outline" size={35} color="#000000" />
        </TouchableOpacity>
      </View>
    </View>
  );
}
